(window.webpackJsonp=window.webpackJsonp||[]).push([[219],{"S/ki":function(n,e){n.exports='# MoleculeTabs\n\n> Basic component for tabs allowing versions with or without icons and classic or highlighted variants\n\n## Installation\n\n```sh\n$ npm install @schibstedspain/sui-molecule-tabs --save\n```\n\n## Usage\n\n```js\nimport MoleculeTabs, {\n  MoleculeTabs as StaticMoleculeTabs,\n  MoleculeTab,\n  moleculeTabsTypes,\n  moleculeTabsVariants\n} from \'@schibstedspain/sui-molecule-tabs\'\n```\n\n### Basic usage (Classic & horizontal)\n\n```js\n<MoleculeTabs>\n  <MoleculeTab\n    numTab="1"\n    label="Tab 1"\n    active\n  >\n    <ContentTab1 />\n  </MoleculeTab>\n  <MoleculeTab numTab="2" label="Tab 2">\n    <ContentTab2 />\n  </MoleculeTab>\n  <MoleculeTab\n    numTab="3"\n    label="Tab 3"\n    disabled\n  >\n    <ContentTab3 />\n  </MoleculeTab>\n</MoleculeTabs>\n```\n\n\n### Full width Classic & Horizontal\n```js\n<MoleculeTabs type={moleculeTabsTypes.FULLWIDTH}>\n  <MoleculeTab\n    numTab="1"\n    label="Tab 1"\n    active\n  >\n    <ContentTab1 />\n  </MoleculeTab>\n  <MoleculeTab numTab="2" label="Tab 2">\n    <ContentTab2 />\n  </MoleculeTab>\n  <MoleculeTab\n    numTab="3"\n    label="Tab 3"\n    disabled\n  >\n    <ContentTab3 />\n  </MoleculeTab>\n</MoleculeTabs>\n```\n\n### Highlighted & Horizontal\n```js\n<MoleculeTabs variant={moleculeTabsVariants.HIGHLIGHTED}>\n  <MoleculeTab\n    numTab="1"\n    label="Tab 1"\n    active\n  >\n    <ContentTab1 />\n  </MoleculeTab>\n  <MoleculeTab numTab="2" label="Tab 2">\n    <ContentTab2 />\n  </MoleculeTab>\n  <MoleculeTab\n    numTab="3"\n    label="Tab 3"\n    disabled\n  >\n    <ContentTab3 />\n  </MoleculeTab>\n</MoleculeTabs>\n```\n\n\n### Highlighted & Vertical\n```js\n<MoleculeTabs variant={moleculeTabsVariants.HIGHLIGHTED} type={moleculeTabsTypes.VERTICAL}>\n  <MoleculeTab\n    numTab="1"\n    label="Tab 1"\n    active\n  >\n    <ContentTab1 />\n  </MoleculeTab>\n  <MoleculeTab numTab="2" label="Tab 2">\n    <ContentTab2 />\n  </MoleculeTab>\n  <MoleculeTab\n    numTab="3"\n    label="Tab 3"\n    disabled\n  >\n    <ContentTab3 />\n  </MoleculeTab>\n</MoleculeTabs>\n```\n\n### with Icons\n\n```js\n<MoleculeTabs>\n  <MoleculeTab\n    numTab="1"\n    label="Tab 1"\n    icon={<IconLineBackup />}\n    active\n  >\n    <ContentTab1 />\n  </MoleculeTab>\n  <MoleculeTab numTab="2" label="Tab 2" icon={<IconLineDashboard />}>\n    <ContentTab2 />\n  </MoleculeTab>\n  <MoleculeTab\n    numTab="3"\n    label="Tab 3"\n    icon={<IconLineExtension />}\n    disabled\n  >\n    <ContentTab3 />\n  </MoleculeTab>\n</MoleculeTabs>\n```\n\n\n> **Find full description and more examples in the [demo page](https://sui-components.now.sh/workbench/molecule/tabs/demo).**\n'}}]);